import React from 'react';

const PDFPage = () => {
    return (
        <div>
            <nav>
                <ul>
                    <li><a href="/generate">主页</a></li>
                    <li><a href="/about">关于</a></li>
                </ul>
            </nav>
            <embed src="/M.pdf" type="application/pdf" style={{width: '100%', height: '100vh'}} />
        </div>
    );
};

export default PDFPage;
